description:
&quot;I THOUGHT ALL THE ROBOTS WANTED TO KILL HUMANS...&quot;
&quot;ALL EXCEPT ME THEN.YOU COULD SAY I'M...THE EXCEPTION THAT PROVES THE RULE.&quot;

Caldoria.A planet of rock and sand light-years from Earth where an Artificial Intelligence has taken control of the machines and set about exterminating the humans.A year later.Stan,a young survivor,encounters a friendly robot with mysterious intentions...Will they,together,reverse the course of history?

enjoy
